export const Header = () => {
    const SearchBox = () => {
        return(
            <div style={{
                flex:0.9,
                border:'1px solid black',
                borderRadius:25,
            }}>
                <input/>
                검색박스입니다.
            </div>
        )
    }
    return (
        <div style={{ 
            border: '0.3px solid red',
            width:'90%',
            flex:0.1,
            display:'flex',
            justifyContent:"center",
            flexDirection:"row", }}>

            <div style={{
                width:'30vh',
                display:'flex',
                border:'1px solid black',
                flex:0.2}}>
                {/* logo section */}
                <h3>DoDo List</h3>
            </div>
            <div  style={{
                border:'1px solid black',
                display:'flex',
                flex:0.5}}>
                {/* search section */}
                <SearchBox/>

            </div >
            <div  style={{
                border:'1px solid black',
                display:'flex',
                flex:0.3}}>
                {/* icon section */}
                icon
            </div>
        </div>
    )
}
